cssBlocks.cssBlock1:
.search.icon {
  width: 12px;
  height: 12px;
  border: solid 1px #333333;
  border-radius: 100%;
  -webkit-transform: rotate(-45deg);
  transform: rotate(-45deg);
}

cssBlocks.cssIcon:
.search.icon {
  margin-top: 2px;
  margin-left: 3px;
  width: 12px;
  height: 12px;
  border: solid 1px currentColor;
  border-radius: 100%;
  -webkit-transform: rotate(-45deg);
  transform: rotate(-45deg);
}

cssBlocks.cssIconBefore:
.search.icon:before {
  top: 12px;
  left: 5px;
  height: 6px;
  width: 1px;
  background-color: currentColor;
}

cssBlocks.cssChild:
.search.icon.plusI i {
  left: 4px;
  top: 4px;
  -webkit-transform: rotate(45deg);
  transform: rotate(45deg);
}

cssBlocks.cssChildAfter:
.search.icon.plusI i:after {
  width: 6px;
  height: 1px;
  background-color: currentColor;
  -webkit-transform: rotate(90deg);
  transform: rotate(90deg);
}
